import {
  IonAvatar,
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from "@ionic/react";

import { useAuth0 } from "@auth0/auth0-react";
import "./Home.css";
import LoginButton from "../components/LoginButton";
import LogoutButton from "../components/LogoutButton";
import Profile from "../components/Profile";

const Home: React.FC = () => {
  const { isLoading, isAuthenticated } = useAuth0();

  if (isLoading) {
    return null;
  }

  return (
    <IonPage >
      <IonHeader>
        {/* this is the header title */}
        <IonToolbar>
          <IonTitle>ブランド名</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent >
        <div className="ion-content">

          <Profile />
          {isAuthenticated ? <LogoutButton /> : <LoginButton />}


        </div>
        {/* <IonHeader collapse="condense">
          <IonToolbar>
            <IonTitle size="large">Auth0 React Sample</IonTitle>
          </IonToolbar>
        </IonHeader> */}
      </IonContent>
    </IonPage>
  );
};

export default Home;
